import React from 'react';
import logo from './logo.svg';
import './App.css';

class MapView extends React.Component {
  render() {
    return (
      <div id="mapid" class="map"></div>
    );
  }
}

function App() {
  return (
    <div className="App">
      <MapView/>
    </div>
  );
}

export default App;
